import { Component } from 'react';

class StrapiAuth extends Component {

  constructor(props) {
    super(props);

    this.state = {
      user: []
    }

    // PUT AXIOS AUTH FUNCTIONS HERE
    this.Authenticate = () => {
      console.log("authenticate");
    }

  }

}

export default StrapiAuth;
